Template.editor.rendered = function() {
     $('#summernote').summernote({
         height: 200,   // set editable area's height
         focus: true,    // set focus editable area after Initialize summernote
         lang: 'es-ES',
         tabsize: 2,
         styleWithSpan: false,
         codemirror: { 
   			 theme: 'journal'
  		}
     });
};

Template.editor.events({
	'click .save'(event, instance) {
		var html = $('#summernote').summernote('code');
		Texto.insert({'valor': html});
		$('#summernote').summernote('code', "");
	},
	'click .cargar'(event, instance) {
		var text = "<h2><b><font color='#0000ff'>Probando</font></b></h2><h4><b><font color='#0000ff'><br></font></b></h4><h4><b>Prueba de Summer Note</b></h4><h4><b><br></b></h4><h4><img src='data:image/jpeg;base64,' data-filename='IMG-20160407-WA0006.jpg' style='width: 245px;'><b><br></b></h4><h2><b><font color='#0000ff'><br></font></b></h2>";
		$('#summernote').summernote('code', text);
	},

});